import React, { Component } from 'react'
import {
    Route,
    NavLink,
    HashRouter
} from 'react-router-dom'
import About from "./About"
import './NavButtons.css'

export default function NavButton(){

    return (
        <aside className="NavBar">

            <div className="NavButton"><span>About</span></div>
            <div className="NavButton"><span>Contact</span></div>
            <div className="NavButton"><span>Portfolio</span></div>
            <div className="NavButton"><span>Resume</span></div> 

        </aside>

    )

}
